import React from 'react'
import breakfast from '../images/hero6.jpg'

const HeadlineCards = () => {
  return (
    <div className='max-w-[640] mx-auto p-4 py-12 grid md:grid-cols-3 gap-6'>
        {/* Card */}
        <div className='rounded-xl relative'>
            {/* Overlay */}
            <div className='absolute w-full h-[300px] bg-black/50 rounded-xl text-white '>
                <p className='font-bold text-2xl px-2 pt-4'>Breakfast</p>
                <button>View More</button>
            </div>
            <img src={breakfast} alt="" />
        </div>
    </div>
  )
}

export default HeadlineCards
